INSERT INTO `exercise` VALUES (2,4,'standing barbell rear delt row','standing barbell rear delt row',1,3),(3,1,'skull crusher','skull crusher',1,6),(4,4,'barbell shrug','barbell shrug',1,10),(5,1,'Скручивания на полу (ноги вверху)','Поднимать туловище до конца не обязательно. Ваша задача максимально скрутиться. Согнутые ноги позволяют сильнее сократить пресс. Поэтому такой вариант делать сложнее, чем с прямыми ногами.\n\nОсновные фишки\n\n1. Когда ноги у вас на верху, то пресс быстрее и сильнее забивается. Ведь пресс уже находится в немного сокращённом положении, когда вы сгибаете ноги в тазобедренных суставах. Поэтому, такой вариант немного посложнее, чем если бы ноги лежали на полу.\n\n2. Если будете опускаться до конца и касаться лопатками пола, то амплитуда движения будет максимальной. Однако так проще, и вы сможете сделать больше повторений. Ведь в таком случае пресс в нижней точке будет отдыхать. Это не плохо и не хорошо. Кому как больше нравится.\n\n3. Вес (например, диск от штанги) можно держать как на груди, так и за головой. На груди легче, а за головой посложнее.\n\n4. Старайтесь скрутиться по максимуму. Как будто хотите коснуться лбом коленей.\n\n5. Это упражнение хорошо подходит для домашних условий. Однако, у него есть один недостаток. Это довольно короткая амплитуда движения. Кто-то скажет, что для пресса этой амплитуды вполне достаточно. В принципе, да. Но мне всегда больше нравились упражнения с большей амплитудой.',NULL,21),(6,6,'Отжимания от пола широким хватом','Отличное и простое упражнение. Если поставить ноги на небольшую подставку - будет тяжелее. А если еще и руки поставить на подставки, чтобы можно было ниже опускаться - будет еще жестче. А если ещё диски на спину положить... )\n\nВ общем, если вы можете полностью отжаться от пола хотя бы раз 15 - утяжеляйте себе задание приведёнными выше способами. С дополнительным отягощением это упражнение вполне способно развить силу и массу ваших грудных мышц.\n\nОсновные фишки\n\n1. Ноги и спина должны составлять одну прямую линию в процессе всего упражнения. То есть не нужно задирать таз, или опускать его, прогибая спину. Так отжиматься легче, однако вы будете отжимать не всё тело, как бы.\n\n2. Для увеличения скоростных качеств мышц (особенно актуально для занимающихся единоборствами) можно отжиматься с хлопками. Самый простой вариант, это хлопки перед собой. Посложнее – хлопки за головой. А самый сложный – хлопки за спиной.\n\n3. Если поставите руки на подставки, то сможете опускаться ниже. А чем ниже опуститесь, тем сильнее растянется грудь или трицепс (смотря, на что делаете акцент). Значит и эффективность упражнения будет выше. В качестве подставок могут быть специальные упоры для отжиманий, плинты, диски, гири. В принципе, что угодно.\n\n4. Тем, кто хочет больше жать лёжа, рекомендую при отжиманиях руки ставить так, как при жиме лёжа. То есть техника отжиманий должна копировать технику жима лёжа.\n\n5. При широкой постановке рук и разведении локтей максимально в стороны, грудь работает больше всего. Однако и нагрузка на плечевые суставы максимальная. Поэтому, будьте осторожны с такой техникой.',NULL,24),(8,3,'Приседания с гантелями','Хорошо подходит для новичков в качестве разучивания техники в приседаниях. Плюс еще в том, что нет прямой нагрузки на позвоночник. Ну а вообще, как вы уже наверное догадались, большие веса с гантелями не поделаешь.',2,27),(9,5,'Жим гантелей сидя','Как и любое упражнение с гантелями, его делать труднее чем со штангой. Поэтому, потренируйтесь для начала со штангой. Плюс в том, что гантели можно разворачивать, как внизу, так и вверху. Еще хороший вариант - жать гантели попеременно.\n\nПри жиме гантелей чуть больше работает средняя дельта, так как гантели внизу располагаются (при правильной технике) сбоку от головы.',2,30),(10,2,'Сгибания рук с гантелями сидя','Существуют разные варианты. С разворотом гантели вверху, так больше нагружается наружняя головки бицепса. Без разворота (молоток), сильнее работает внутренняя головка. А также с опорой на скамью под разными углами. чем ниже угол, тем тяжелее делать упражнение.',2,33);
