INSERT INTO `exercise_part` VALUES (1,2,1,4,'Hold a barbell with a slightly wider than shoulder-width grip, bending over at the hips and keeping your back straight. Let the bar hang down in front of you.'),(2,2,2,5,'Pull the barbell in to your upper chest in a controlled manner, focusing on contracting your rear delts. Repeat.'),(3,3,1,7,'Lie back on a bench and grip a loaded barbell. Lower the bar and, when you start to feel the tension in your triceps shift to your chest, bring the bar back toward your skull. The bar path should resemble an L shape.'),(4,3,2,8,'Contract the triceps hard and reverse the bar back to the starting position.'),(5,4,1,9,'Standing with your feet shoulder-width apart, place a barbell in front of your thighs, hands shoulder-width apart, palms facing your body, and arms fully extended.'),(6,4,2,10,'Keeping your arms straight, shrug your shoulders as high as you can. Pause, then lower to the start position.'),(7,5,1,22,'Лягте на пол, желательно, на гимнастический коврик. Руки заведите за голову. Ноги в коленях согните, стопы поместите на пол. Выгните поясницу, вдохните и растяните мышцы живота.'),(8,5,2,23,'Выдыхая, приподнимите верхнюю часть туловища к ногам, при этом, сокращая мышцы пресса. Нижнюю часть спины держите на полу в неподвижном состоянии. Вдыхая, отклонитесь назад, по максимуму растянув мышцы живота. Повторите упражнение необходимое количество раз, в течение всего подхода держа мышцы пресса напряженными.'),(9,6,1,25,'Примите упор лежа на прямых руках. Слишком широко ладони расставлять не нужно (это может повлечь за собой травму) – ставим их немного шире плеч. Кисти можно слегка развести в стороны для удобства. Корпус абсолютно прямой, прогиба в пояснице нет, шея – продолжение позвоночника, взгляд опущен, мышцы пресса напряжены.'),(10,6,1,26,'На вдохе, удерживая корпус абсолютно прямым, сгибайте руки разводя локти в стороны. Грудью вы должны практически достать до пола.\nНа выдохе, сосредоточившись на том, как сокращаются грудные мышцы, отожмитесь и вернитесь в исходное положение.'),(11,8,1,28,'Встаньте ровно. Прогните поясницу, взгляд направьте под углом 45° вверх. Стопы — на ширине плеч, носки смотрят в стороны.'),(12,8,2,29,'Возьмите гантели и свободно опустите руки по бокам.\nГлубоко вдохните и плавно отведите таз назад.\nДостигнув нижней точки, на выдохе вытолкните корпус вверх. В верхней фазе не расправляйте колени до конца. В противном случае полезная нагрузка будет спадать.'),(13,9,1,31,'Сядьте прямо, поясница прогнута чуть вперед. Лопатки сведены, плечи расправлены.\nВозьмите гантели с пола, разведите руки с ними как сказано выше. Гантели должны оказаться на уровне плеч. Это начальная позиция.'),(14,9,2,32,'Поднимите на выдохе гантели вверх, можно коснуться ими друг друга (сильно не бейте, все-таки не нужно портить имущество тренажерного зала).\nОпустите гантели до уровня ушей или чуть ниже. Здесь нюанс — когда вы опускаете вес ниже затылка — начинает работать верхняя часть трапеции. Если вы хотите ее задействовать — опускайте гантели максимально вниз. Если же вы прокачиваете именно дельтоиды (отличный вариант для девушек) — ниже затылка опускать гантель не следует.'),(17,10,1,34,'Поставьте стопы на ширине плеч, опустите руки с гантелями вдоль корпуса. Кисти повернуты к телу, локти чуть согнуты. Полностью в локтевом суставе руки разгибать не нужно. Во-первых, при работе с большими весами это травмоопасно. А во-вторых, когда вы не разгибаете локти, мышцы все время находятся в напряжении, а, значит, тренировка приносит больший эффект.\nЗафиксируйте положение локтей, прижав их к корпусу, напрягите пресс.'),(18,10,2,35,'Медленно сгибайте руки в локтях. Когда предплечья будут параллельны полу, начинайте разворачивать кисти наружу, то есть кверху запястьями. Это движение называется супинацией.\nПоднимите гантели до того уровня, когда запястья практически коснутся плеч. Прижимать руки к плечам не нужно, так как это частично снимает нагрузку с мышц. То есть в верхней точке упражнения между вашими запястьями и плечами должно оставаться несколько сантиметров.\nЗадержитесь в верхней точке на 1–2 секунды и так же медленно опустите руки.');
