INSERT INTO `program` VALUES (1,'Shoulders, Traps, And Arms',11,'Shoulders, Traps, And Arms',2,120),(2,'Круговая тренировка для мужчин день 1',36,'Круговая тренировка для мужчин день 1. Как и все программы, основанные на круговом методе, эта программа направлена на сжигание жира. Причём данный комплекс ориентирован на тех, у кого дома есть только гантели. Желательно – разборные гантели. Если же у вас есть ещё и штанга или скамья, то можете самостоятельно разнообразить эти тренировки дополнительными упражнениями. Для этого воспользуйтесь кнопкой \"аналоги\".',3,120);
/*!40000 ALTER TABLE `program` ENABLE KEYS */;
